const COLORS = {
    white : '#FFF',
    dark : '#000',
    primary : '#056D68',
    secondary : '#83C9C5',
    light : '#e5e5e5',
    grey : '#908e8c',
    yellow: '#FDD316'
};

export default COLORS;
